import React from "react";
import GoogleMapReact from "google-map-react";
import "./Map.css";

export default function Map({ location, zoomLevel }) {
  return (
    <div className="map">
      <h2>Google Map</h2>
      
    </div>
  );
}

const LocationPin = ({ text }) => <p>{text}</p>;
